import SideBarLink from "./SideBarLink";

const SideBar = () => {
  return (
    <div>
      <SideBarLink text="Portraits" />
      <SideBarLink text="Climbing" />
      <SideBarLink text="Landscapes" />
      <SideBarLink text="About" />
      <SideBarLink text="Contact" />
    </div>
  );
};
export default SideBar;
